import React, { Component } from "react";
import {
  Grid,
  Cell,
  Card,
  CardTitle,
  CardText,
  CardMenu,
  IconButton,
} from "react-mdl";

class aboutme extends Component {
  toggleCategories() {
    return (
      <div>
        <section className="projects-grid">
          {/* Project 1 */}
          <Card shadow={5} style={{ minWidth: "450", margin: "auto" }}>
            <CardTitle
              style={{
                color: "#fff",
                height: "176px",
                background:
                  "url(https://cdn2.iconfinder.com/data/icons/profession-avatar-2/128/avatar-marine-soldier-army-512.png) center / cover",
              }}
            ></CardTitle>
            <CardText>
              <h5
                style={{
                  color: "#FF1493",
                  fontFamily: "Arial Black",
                  fontweight: "bold",
                }}
              >
                {" "}
                Geek{" "}
              </h5>
              My favorite field is programming. I like it because everything is
              so logical and with the proper language we can carry out amazing
              projects. 
            </CardText>

            <CardMenu style={{ color: "#fff" }}>
              <IconButton name="share" />
            </CardMenu>
          </Card>

          {/* Project 2 */}

          {/* Project 3 */}
          <Card shadow={5} style={{ minWidth: "450", margin: "auto" }}>
            <CardTitle
              style={{
                color: "#fff",
                height: "176px",
                background:
                  "url(https://cdn0.iconfinder.com/data/icons/office-culture/32/11_office_team_people_avatar_profession-512.png) center / cover",
              }}
            ></CardTitle>
            <CardText>
              <h5
                style={{
                  color: "#FF1493",
                  fontFamily: "Arial Black",
                  fontweight: "bold",
                }}
              >
                {" "}
                Team{" "}
              </h5>
              Setting up real time face detection through a webcam using AI.
              This AI is so quick that we are able to draw in real time the
              various faces and expressions of every person in the video.
            </CardText>

            <CardMenu style={{ color: "#fff" }}>
              <IconButton name="share" />
            </CardMenu>
          </Card>
        </section>
        <br />
        <section className="projects-grid">
          {/* Project 3 */}
          <Card shadow={5} style={{ minWidth: "450", margin: "auto" }}>
            <CardTitle
              style={{
                color: "#fff",
                height: "176px",
                background:
                  "url(https://lh3.googleusercontent.com/proxy/mjF-F04_nN-OsvMHHTBwfJxkKAgYv4gtLPC5uJjUs7kry9Z6eYlev11kLmZ0rjUzcIv-mG8GcIyDxtu14zduOIe1nFEdT7qfNY1Rd53ZXrNd2puVehrz) center / cover",
              }}
            ></CardTitle>
            <CardText>
              <h5
                style={{
                  color: "#FF1493",
                  fontFamily: "Arial Black",
                  fontweight: "bold",
                }}
              >
                {" "}
                Search engine{" "}
              </h5>
              Implement techniques used for hypermedia-oriented automatic
              indexing (textual, ...), as well as the use of SGBD in a storage
              and consultation context.
            </CardText>

            <CardMenu style={{ color: "#fff" }}>
              <IconButton name="share" />
            </CardMenu>
          </Card>
          {/* Project 3 */}
          <Card shadow={5} style={{ minWidth: "450", margin: "auto" }}>
            <CardTitle
              style={{
                color: "#fff",
                height: "176px",
                background:
                  "url(https://www.duniailkom.com/wp-content/uploads/2018/08/Python-Logo-Featured-Image-300x177.png) center / cover",
              }}
            ></CardTitle>
            <CardText>
              <h5
                style={{
                  color: "#FF1493",
                  fontFamily: "Arial Black",
                  fontweight: "bold",
                }}
              >
                {" "}
                WIFI network virtualization
              </h5>
              Training on the Mininet-wifi software solution which enables
              networks, switches, routers, firewalls, etc. to be deployed on a
              single machine, automatically and dynamically via python.
            </CardText>

            <CardMenu style={{ color: "#fff" }}>
              <IconButton name="share" />
            </CardMenu>
          </Card>
          {/* Project 3 */}
          <Card shadow={5} style={{ minWidth: "450", margin: "auto" }}>
            <CardTitle
              style={{
                color: "#fff",
                height: "176px",
                background:
                  "url(https://www.windows8facile.fr/wp-content/uploads/2017/10/oracle-logo.jpg) center / cover",
              }}
            ></CardTitle>
            <CardText>
              <h5
                style={{
                  color: "#FF1493",
                  fontFamily: "Arial Black",
                  fontweight: "bold",
                }}
              >
                {" "}
                Personnal management
              </h5>
              Setting of database interface with Oracle 11g that enable
              employers in the company to enter their information of presence
              without filling the paper works
            </CardText>

            <CardMenu style={{ color: "#fff" }}>
              <IconButton name="share" />
            </CardMenu>
          </Card>
        </section>
      </div>
    );
  }

  render() {
    return (
      <div>
        <Grid>
          <Cell col={12}>
            <div className="content">{this.toggleCategories()}</div>
          </Cell>
        </Grid>
      </div>
    );
  }
}

export default aboutme;
